    def save_profile(self):
        global name, address, date_of_birth, country, linkedIn, email, phone_number,skillsChecked,education,experience
        name = self.name_label.text()
        address = self.address_label.text()
        date_of_birth = self.date_of_birth_label.text()
        country = self.country_label.text()
        linkedIn = self.linkedIn_label.text()
        email = self.email_label.text()
        phone_number = self.phone_number_column.text()
        skillsChecked = self.selectionChanged()
        education = self.educationTextEdit.toPlainText()
        experience = self.experienceTextEdit.toPlainText()

    def load_profile(self):
        global name, address, date_of_birth, country, linkedIn, email, phone_number,education,experience
        self.name_label.setText(name)
        self.address_label.setText(address)
        self.date_of_birth_label.setText(date_of_birth)
        self.country_label.setText(country)
        self.linkedIn_label.setText(linkedIn)
        self.email_label.setText(email)
        self.phone_number_column.setText(phone_number)
        self.checkList()
        self.educationTextEdit.setPlainText(education)
        self.experienceTextEdit.setPlainText(experience)


    def selectionChanged(self):
        checked = []
        for row in range(self.skillsList.count()):
            item = self.skillsList.item(row)
            if item.checkState():
                checked.append(item)
        return checked
    def checkList(self):
        global skillsChecked
        self.clearSkills()
        for row in range(self.skillsList.count()):
            item = self.skillsList.item(row)
            for checked in skillsChecked:
                if checked == item:
                    item.setCheckState(Qt.Checked)
    def clearSkills(self):
        for row in range(self.skillsList.count()):
            item = self.skillsList.item(row)
            item.setCheckState(Qt.Unchecked)
